'program map\', \'0\');\r\n    daedalus_modify_menu(\'program my strengths\', \'0\');\r\n    daedalus_modify_menu(\'program nextstep\', \'0\');\r\n    daedalus_modify_menu(\'program goal\', \'0\');\r\n\r\n    daedalus_modify_menu(\'session log\', \'0\');\r\n    daedalus_modify_menu(\'support student program form\', \'0\');\r\n    daedalus_modify_menu(\'support session log\', \'0\');\r\n\r\n  }\r\n  elseif ( db_result(db_query(\"SELECT COUNT(*) FROM {role, users_roles} \r\n                                          WHERE role.name=\'Magellan Support Staff\' \r\n                                            AND users_roles.uid=%d \r\n                                            AND users_roles.rid = role.rid\", $user_id)) ) {\r\n\r\n    $session_id = db_result(db_query(\"SELECT id FROM {mag_support_session} \r\n                                               WHERE support_id=%d\", $user_id));\r\n\r\n    // Get the session name.\r\n    $current_session = $_COOKIE[session_name()];\r\n\r\n    // If in session, set the user name as\r\n    // to the selected students username.\r\n    if ( $session_id == $current_session ) {\r\n\r\n      $support_in_session = TRUE;\r\n      $advisor_in_session = FALSE;\r\n\r\n    }\r\n    else {\r\n\r\n      $support_in_session = FALSE;\r\n      $advisor_in_session = FALSE;\r\n\r\n    }\r\n\r\n  }\r\n  elseif ( db_result(db_query(\"SELECT COUNT(*) FROM {role, users_roles} \r\n                                              WHERE role.name=\'Magellan Advisor\' \r\n                                                AND users_roles.uid=%d \r\n                                                AND users_roles.rid = role.rid\", $user_id)) ) {\r\n\r\n    $session_id = db_result(db_query(\"SELECT id FROM {mag_advisor_session} \r\n                                               WHERE advisor_id=%d\", $user_id));\r\n\r\n    // Get the session name.\r\n    $current_session = $_COOKIE[session_name()];\r\n\r\n    // If in session, set the user name as\r\n    // to the selected students username.\r\n    if ( $session_id == $current_session ) {\r\n\r\n      $advisor_in_session = TRUE;\r\n      $support_in_session = FALSE;\r\n\r\n    }\r\n    else {\r\n\r\n      $advisor_in_session = FALSE;\r\n      $support_in_session = FALSE;\r\n\r\n    }\r\n\r\n  }\r\n\r\n  if ( !$support_in_session && !$advisor_in_session && $user_id != 1 ) {\r\n\r\n    // Hide the program menu information.\r\n    daedalus_modify_menu(\'my program\', \'1\');\r\n    daedalus_modify_menu(\'program form\', \'1\');\r\n    daedalus_modify_menu(\'program map\', \'1\');\r\n    daedalus_modify_menu(\'program my strengths\', \'1\');\r\n    daedalus_modify_menu(\'program nextstep\', \'1\');\r\n    daedalus_modify_menu(\'program goal\', \'1\');\r\n\r\n    // Hide advisor and support links\r\n    daedalus_modify_menu(\'session log\', \'1\');\r\n    daedalus_modify_menu(\'support student program form\', \'1\');\r\n    daedalus_modify_menu(\'support session log\', \'1\');\r\n\r\n    // If the current user is a Magellan Advisor determine \r\n    // if there is a current advising session open.\r\n    if ( db_result(db_query(\"SELECT COUNT(*) FROM {role, users_roles} \r\n                                            WHERE role.name=\'Student\' \r\n                                              AND users_roles.uid=%d \r\n                                              AND users_roles.rid = role.rid\", $user_id)) ) {\r\n\r\n      $student_name = db_result(db_query(\"SELECT name FROM {users} WHERE uid=%d\", $user_id));\r\n\r\n      if ( db_result(db_query(\"SELECT current_selection FROM {mag_student_identification}\r\n                                                     WHERE user_name=\'%s\'\", $student_name)) ) {\r\n\r\n        // Show all the program menu items\r\n        // if the user has a program selected.\r\n        daedalus_modify_menu(\'my program\', \'0\');\r\n        daedalus_modify_menu(\'program form\', \'0\');\r\n        daedalus_modify_menu(\'program map\', \'0\');\r\n        daedalus_modify_menu(\'program my strengths\', \'0\');\r\n        daedalus_modify_menu(\'program nextstep\', \'0\');\r\n        daedalus_modify_menu(\'program goal\', \'0\');\r\n\r\n      }\r\n      else {\r\n\r\n        // Only show the items that are available.\r\n        daedalus_modify_menu(\'my program\', \'0\');\r\n        daedalus_modify_menu(\'program form\', \'0\');\r\n\r\n      }\r\n\r\n    }\r\n\r\n  }\r\n\r\n?>\r\n<p><img alt=\"Labyrinth\" src=\"http://projects.cs.dal.ca/daedalus_dev/sites/all/modules/custom/daedalus/img/daedalus-homepage.png\" style=\"float:right;width:200px;\" /></p>\r\n<h1>\r\n	What is a curriculum map?</h1>\r\n<div class=\"rteindent1\">\r\n	It itemizes what a student can do after successfully completing a given course.&nbsp;<br />\r\n	&nbsp;</div>\r\n<h1>\r\n	&nbsp;</h1>\r\n<h1>\r\n	What is a Student Learning Outcome (SLO)?</h1>\r\n<div class=\"rteindent1\">\r\n	A SLO is a task to be mastered. Regard it as the building block in defining courses and degrees.<br />\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n<h1>\r\n	What can I do with this site?</h1>\r\n<div class=\"rteindent1\">\r\n	You can browse per course (Browse\\Courses) or by categories (use the tag cloud in Browse\\Learning Outcomes).&nbsp;<br />\r\n	&nbsp;</div>\r\n<h2 class=\"rteindent1\">\r\n	The course view tells you...</h2>\r\n<ol class=\"rteindent1\">\r\n	<li class=\"rteindent1\">\r\n		... what you will learn in this course (roughly)</li>\r\n	<li class=\"rteindent1\">\r\n		... what we assume that you know before you start</li>\r\n	<li class=\"rteindent1\">\r\n		... how this course fits in the grand scheme of things.&nbsp;</li>\r\n</ol>\r\n<h2 class=\"rteindent1\">\r\n	The SLO view tells you...</h2>\r\n<ol>\r\n	<li class=\"rteindent2\">\r\n		... what you need to be able to do before you get there.</li>\r\n	<li class=\"rteindent2\">\r\n		... why you need to know how to do this SLO.</li>\r\n	<li class=\"rteindent2\">\r\n		... which course(s) cover this SLO.</li>\r\n	<li class=\"rteindent2\">\r\n		... which course(s) prepares you for this SLO.</li>\r\n</ol>\r\n<!--<div class=\"rteindent2\">\r\n	&nbsp;</div>-->\r\n<h2 class=\"rteindent1\">\r\n	Why do I want to Log in (and how)?</h2>\r\n<ol>\r\n	<li class=\"rteindent2\">\r\n		Log in with your csid and password.</li>\r\n	<li class=\"rteindent2\">\r\n		Once logged in, you can create a program form and keep track of your progress.</li>\r\n	<li class=\"rteindent2\">\r\n		There are other tools to help you find out what you do best, and what you need to worry about for your upcoming courses.</li>\r\n</ol>\r\n\";s:5:\"#rows\";i:20;s:9:\"#required\";b:0;}s:6:\"format\";a:10:{s:5:\"#type\";s:8:\"fieldset\";s:6:\"#title\";s:12:\"Input format\";s:12:\"#collapsible\";b:1;s:10:\"#collapsed\";b:1;s:7:\"#weight\";N;s:17:\"#element_validate\";a:1:{i:0;s:20:\"filter_form_validate\";}i:1;a:7:{s:5:\"#type\";s:5:\"radio\";s:6:\"#title\";s:13:\"Filtered HTML\";s:14:\"#default_value\";s:1:\"3\";s:13:\"#return_value\";s:1:\"1\";s:8:\"#parents\";a:1:{i:0;s:6:\"format\";}s:12:\"#description\";s:306:\"<ul class=\"tips\"><li>Web page addresses and e-mail addresses turn into links automatically.</li><li>Allowed HTML tags: &lt;a&gt; &lt;em&gt; &lt;strong&gt; &lt;cite&gt; &lt;code&gt; &lt;ul&gt; &lt;ol&gt; &lt;li&gt; &lt;dl&gt; &lt;dt&gt; &lt;dd&gt;</li><li>Lines and paragraphs break automatically.</li></ul>\";s:3:\"#id\";s:13:\"edit-format-1\";}i:2;a:7:{s:5:\"#type\";s:5:\"radio\";s:6:\"#title\";s:9:\"Full HTML\";s:14:\"#default_value\";s:1:\"3\";s:13:\"#return_value\";s:1:\"2\";s:8:\"#parents\";a:1:{i:0;s:6:\"format\";}s:12:\"#description\";s:151:\"<ul class=\"tips\"><li>Web page addresses and e-mail addresses turn into links automatically.</li><li>Lines and paragraphs break automatically.</li></ul>\";s:3:\"#id\";s:13:\"edit-format-2\";}i:3;a:7:{s:5:\"#type\";s:5:\"radio\";s:6:\"#title\";s:8:\"PHP code\";s:14:\"#default_value\";s:1:\"3\";s:13:\"#return_value\";s:1:\"3\";s:8:\"#parents\";a:1:{i:0;s:6:\"fo