INSERT INTO `node_revisions` VALUES (1,1,1,'Curriculum Mapping at Dal FCS','<?php\r\n\r\n  /**\r\n   * The code below is in place to hide menu links\r\n   * for the various roles in Magellan module.\r\n   */\r\n\r\n  global $base_url;\r\n  global $user;\r\n  $user_id = $user->uid;\r\n\r\n  if ( module_exists(\'magellan\') ) {\r\n\r\n    if ( $user_id == 1 ) {\r\n\r\n      // If root user, show everything.\r\n      daedalus_modify_menu(\'my program\', \'0\');\r\n      daedalus_modify_menu(\'program form\', \'0\');\r\n      daedalus_modify_menu(\'program map\', \'0\');\r\n      daedalus_modify_menu(\'program my strengths\', \'0\');\r\n      daedalus_modify_menu(\'program nextstep\', \'0\');\r\n      daedalus_modify_menu(\'program goal\', \'0\');\r\n\r\n      daedalus_modify_menu(\'session log\', \'0\');\r\n      daedalus_modify_menu(\'support student program form\', \'0\');\r\n      daedalus_modify_menu(\'support session log\', \'0\');\r\n\r\n    }\r\n    elseif ( db_result(db_query(\"SELECT COUNT(*)\r\n                                   FROM {role, users_roles} \r\n                                  WHERE role.name=\'Magellan Support Staff\' \r\n                                    AND users_roles.uid=%d \r\n                                    AND users_roles.rid = role.rid\", $user_id)) ) {\r\n\r\n      $session_id = db_result(db_query(\"SELECT id\r\n                                          FROM {mag_support_session} \r\n                                         WHERE support_id=%d\", $user_id));\r\n\r\n      // Get the session name.\r\n      $current_session = $_COOKIE[session_name()];\r\n\r\n      // If in session, set the user name as\r\n      // to the selected students username.\r\n      if ( $session_id == $current_session ) {\r\n        $support_in_session = TRUE;\r\n        $advisor_in_session = FALSE;\r\n      }else {\r\n        $support_in_session = FALSE;\r\n        $advisor_in_session = FALSE;\r\n      }\r\n\r\n    }\r\n    elseif ( db_result(db_query(\"SELECT COUNT(*)\r\n                                   FROM {role, users_roles} \r\n                                  WHERE role.name=\'Magellan Advisor\' \r\n                                    AND users_roles.uid=%d \r\n                                    AND users_roles.rid = role.rid\", $user_id)) ) {\r\n\r\n      $session_id = db_result(db_query(\"SELECT id\r\n                                          FROM {mag_advisor_session}\r\n                                         WHERE advisor_id=%d\", $user_id));\r\n\r\n      // Get the session name.\r\n      $current_session = $_COOKIE[session_name()];\r\n\r\n      // If in session, set the user name as\r\n      // to the selected students username.\r\n      if ( $session_id == $current_session ) {\r\n        $advisor_in_session = TRUE;\r\n        $support_in_session = FALSE;\r\n      }else {\r\n        $advisor_in_session = FALSE;\r\n        $support_in_session = FALSE;\r\n      }\r\n\r\n    }\r\n\r\n    if ( !$support_in_session && !$advisor_in_session && $user_id != 1 ) {\r\n\r\n      // Hide the program menu information.\r\n      daedalus_modify_menu(\'my program\', \'1\');\r\n      daedalus_modify_menu(\'program form\', \'1\');\r\n      daedalus_modify_menu(\'program map\', \'1\');\r\n      daedalus_modify_menu(\'program my strengths\', \'1\');\r\n      daedalus_modify_menu(\'program nextstep\', \'1\');\r\n      daedalus_modify_menu(\'program goal\', \'1\');\r\n\r\n      // Hide advisor and support links\r\n      daedalus_modify_menu(\'session log\', \'1\');\r\n      daedalus_modify_menu(\'support student program form\', \'1\');\r\n      daedalus_modify_menu(\'support session log\', \'1\');\r\n\r\n      // If the current user is a Magellan Advisor determine \r\n      // if there is a current advising session open.\r\n      if ( db_result(db_query(\"SELECT COUNT(*)\r\n                                 FROM {role, users_roles} \r\n                                WHERE role.name=\'Student\' \r\n                                  AND users_roles.uid=%d \r\n                                  AND users_roles.rid = role.rid\", $user_id)) ) {\r\n\r\n        $student_name = db_result(db_query(\"SELECT name FROM {users} WHERE uid=%d\", $user_id));\r\n\r\n        if ( db_result(db_query(\"SELECT current_selection\r\n                                   FROM {mag_student_identification}\r\n                                  WHERE user_name=\'%s\'\", $student_name)) ) {\r\n\r\n          // Show all the program menu items\r\n          // if the user has a program selected.\r\n          daedalus_modify_menu(\'my program\', \'0\');\r\n          daedalus_modify_menu(\'program form\', \'0\');\r\n          daedalus_modify_menu(\'program map\', \'0\');\r\n          daedalus_modify_menu(\'program my strengths\', \'0\');\r\n          daedalus_modify_menu(\'program nextstep\', \'0\');\r\n          daedalus_modify_menu(\'program goal\', \'0\');\r\n\r\n        }else {\r\n\r\n          // Only show the items that are available.\r\n          daedalus_modify_menu(\'my program\', \'0\');\r\n          daedalus_modify_menu(\'program form\', \'0\');\r\n\r\n        }\r\n\r\n      }\r\n\r\n    }\r\n\r\n  }\r\n\r\n  // Get all setting for the page.\r\n  $result = db_query(\"SELECT setting, value \r\n                        FROM {dae_settings} \r\n                       WHERE setting=\'browse courses\' OR\r\n                             setting=\'browse learning outcomes\'\");\r\n\r\n  $page_url = array();\r\n  while ( $row = db_fetch_array($result) ) {\r\n    $page_url[$row[\'setting\']] = $base_url . \'/\' . $row[\'value\'];\r\n  }\r\n\r\n?>\r\n<br />\r\n<div>\r\n  <img alt=\"Labyrinth\" src=\"http://projects.cs.dal.ca/daedalus_dev/sites/all/modules/custom/daedalus/img/daedalus-homepage.png\" style=\"float:right;width:200px;\" />\r\n</div>\r\n<div>\r\n  <h1>What is a curriculum map?</h1>\r\n  <p style=\"text-indent: 15px\">\r\n    It itemizes what a student can do after successfully completing a given course.\r\n  </p>\r\n</div>\r\n<br />\r\n<div>\r\n  <h1>What is a Student Learning Outcome (SLO)?</h1>\r\n  <p style=\"text-indent: 15px\">\r\n    A SLO is a task to be mastered. Regard it as the building block in defining courses and degrees.\r\n  </p>\r\n</div>\r\n<br />\r\n<div>\r\n  <h1>What can I do with this site?</h1>\r\n  <p style=\"text-indent: 15px;\">\r\n    You can browse per course <a href=\"<? echo $page_url[\'browse courses\']; ?>\"><b>here</b></a> or by categories using the <a href=\"<? echo $page_url[\'browse learning outcomes\']; ?>\"><b>tag cloud</b></a>.\r\n  </p>\r\n  <br />\r\n  <div>\r\n    <h1 class=\"title\" style=\"text-indent: 15px;\">The course view tells you...</h1>\r\n      <p style=\"text-indent: 25px;\">\r\n        1. ...what you will learn in this course. (roughly)\r\n      </p>\r\n      <p style=\"margin-top: -12px; text-indent: 25px;\">\r\n        2. ...what we assume that you know before you start.\r\n      </p>\r\n      <p style=\"margin-top: -12px; text-indent: 25px;\">\r\n        3. ...how this course fits in the grand scheme of things.\r\n      </p>\r\n    <h1 class=\"title\" style=\"text-indent: 25px;\">The SLO view tells you...</h1>\r\n      <p style=\"text-indent: 35px;\">\r\n        1. ...what you need to be able to do before you get there.\r\n      </p>\r\n      <p style=\"margin-top: -12px; text-indent: 35px;\">\r\n        2. ...why you need to know how to do this SLO.\r\n      </p>\r\n      <p style=\"margin-top: -12px; text-indent: 35px;\">\r\n        3. ...which course(s) cover this SLO.\r\n      </p>\r\n      <p style=\"margin-top: -12px; text-indent: 35px;\">\r\n        4. ...which course(s) prepares you for this SLO.\r\n      </p>\r\n    <h1 class=\"title\" style=\"text-indent: 35px;\">Why do I want to Log in (and how)?</h1>\r\n      <p style=\"text-indent: 45px;\">\r\n        1. Log in with your csid and password.\r\n      </p>\r\n      <p style=\"margin-top: -12px; text-indent: 45px;\">\r\n        2. Once logged in, you can cr